DROP TABLE IF EXISTS `messages`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `messages` (
  `id` int NOT NULL AUTO_INCREMENT,
  `bot_id` int NOT NULL,
  `user_id` int DEFAULT NULL,
  `conversation_id` int NOT NULL,
  `sender` varchar(50) NOT NULL DEFAULT 'user',
  `message_text` text NOT NULL,
  `file_id` int DEFAULT NULL,
  `tokens_used` int DEFAULT '0',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `source` varchar(50) DEFAULT 'widget',
  `status` varchar(20) DEFAULT 'sent',
  `reply_to_message_id` int DEFAULT NULL,
  `temp_id` varchar(50) DEFAULT NULL,
  `read` tinyint(1) DEFAULT '0',
  `public_user_id` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `bot_id` (`bot_id`),
  KEY `user_id` (`user_id`),
  KEY `conversation_id` (`conversation_id`),
  KEY `fk_messages_reply` (`reply_to_message_id`),
  KEY `fk_messages_public_user` (`public_user_id`),
  KEY `idx_messages_conversation_createdat` (`conversation_id`,`created_at`),
  KEY `idx_messages_file_id` (`file_id`),
  KEY `idx_messages_temp_id` (`temp_id`),
  KEY `idx_messages_status` (`status`),
  KEY `idx_messages_temp_id_conversation` (`temp_id`,`conversation_id`),
  KEY `ix_messages_conversation_id` (`conversation_id`),
  KEY `ix_messages_created_at_desc` (`created_at` DESC),
  CONSTRAINT `fk_messages_file_id` FOREIGN KEY (`file_id`) REFERENCES `chat_uploaded_files` (`id`) ON DELETE SET NULL,
  CONSTRAINT `fk_messages_public_user` FOREIGN KEY (`public_user_id`) REFERENCES `public_users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `fk_messages_reply` FOREIGN KEY (`reply_to_message_id`) REFERENCES `messages` (`id`) ON DELETE SET NULL,
  CONSTRAINT `messages_ibfk_1` FOREIGN KEY (`bot_id`) REFERENCES `bots` (`id`) ON DELETE CASCADE,
  CONSTRAINT `messages_ibfk_2` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`),
  CONSTRAINT `messages_ibfk_3` FOREIGN KEY (`conversation_id`) REFERENCES `conversations` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=298 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
